import { useState } from 'react';
import { cadastrarPrato } from '../services/pratosService';
import { useNavigate } from 'react-router-dom';

function Cadastro() {
  const navigate = useNavigate();

  const [prato, setPrato] = useState({
    nome: '',
    descricao: '',
    preco: '',
    categoria: 'ENTRADA',
    disponibilidade: 'EM_ESTOQUE',
    urlImagem: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setPrato({ ...prato, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await cadastrarPrato({ ...prato, preco: parseFloat(prato.preco) });
      alert('Prato cadastrado com sucesso!');
      navigate('/listar');
    } catch (error) {
      alert('Erro ao cadastrar prato');
      console.error(error);
    }
  };

  return (
    <div className="flex items-center justify-center min-h-screen bg-gradient-to-br from-orange-100 to-yellow-200">
      <div className="bg-white shadow-lg rounded-2xl p-8 w-full max-w-md">
        <h2 className="text-2xl font-bold text-center mb-6">Cadastro de Pratos</h2>
        <form onSubmit={handleSubmit} className="space-y-4">
          <input
            type="text"
            name="nome"
            placeholder="Nome"
            value={prato.nome}
            onChange={handleChange}
            required
            className="w-full px-4 py-2 border rounded-lg"
          />

          <textarea
            name="descricao"
            placeholder="Descrição"
            value={prato.descricao}
            onChange={handleChange}
            required
            className="w-full px-4 py-2 border rounded-lg"
          />

          <input
            type="number"
            step="0.01"
            name="preco"
            placeholder="Preço"
            value={prato.preco}
            onChange={handleChange}
            required
            className="w-full px-4 py-2 border rounded-lg"
          />

          <input
            type="url"
            name="urlImagem"
            placeholder="URL da Imagem"
            value={prato.urlImagem}
            onChange={handleChange}
            required
            className="w-full px-4 py-2 border rounded-lg"
          />

          <div className="flex flex-col">
            <label className="font-medium mb-1">Categoria</label>
            <select
              name="categoria"
              value={prato.categoria}
              onChange={handleChange}
              className="w-full px-4 py-2 border rounded-lg"
            >
              <option value="ENTRADA">Entrada</option>
              <option value="PRATOPRINCIPAL">Principal</option>
              <option value="SOBREMESA">Sobremesa</option>
              <option value="BEBIDA">Bebida</option>
            </select>
          </div>

          <div className="flex flex-col">
            <label className="font-medium mb-1">Disponibilidade</label>
            <select
              name="disponibilidade"
              value={prato.disponibilidade}
              onChange={handleChange}
              className="w-full px-4 py-2 border rounded-lg"
            >
              <option value="EM_ESTOQUE">Em Estoque</option>
              <option value="ESGOTADO">Fora de Estoque</option>
            </select>
          </div>

          <div className="flex flex-col gap-3">
            <button
              type="submit"
              className="bg-orange-500 text-white py-2 px-4 rounded-lg hover:bg-orange-600 transition"
            >
              Cadastrar Prato
            </button>

            <button
              type="button"
              onClick={() => navigate('/listar')}
              className="bg-gray-500 text-white py-2 px-4 rounded-lg hover:bg-gray-600 transition"
            >
              Ver Pratos Cadastrados
            </button>
          </div>
        </form>
      </div>
    </div>
  );
}

export default Cadastro;
